            getWebLoggerContext = MethodUtils.getAccessibleMethod(clazz, "getWebLoggerContext", ServletContext.class);
        } catch (Exception e) {
            logger.error("exception getting accessible method getWebLoggerContext", e);
            throw e;
        }
        Object loggerContext;
        try {
            loggerContext = getWebLoggerContext.invoke(null, ctx);
        } catch (Exception e) {
            logger.error("exception in getWebLoggerContext", e);
            throw e;
        }
        if (loggerContext == null) {
            throw new NullPointerException(getTarget().getClass().getName() + "#getWebLoggerContext(Ljavax/servlet/ServletContext) returned null");
        }
        result = new Log4J2LoggerContextAccessor();
        result.setTarget(loggerContext);
        result.setApplication(getApplication());
    } catch (Exception e) {
        logger.error("{}#getWebLoggerContext(Ljavax/servlet/ServletContext) failed", getTarget().getClass().getName(), e);
    }
    logger.debug("getWebLoggerContext(): OUT: result={}", result);
    return result;
}

