void handleResponseFromServiceToHttpResponse(Response<Object> response,HttpRequest originatingRequest){
    final String key = Str.add("" + originatingRequest.id(), "|", originatingRequest.returnAddress());
    this.outstandingRequestMap.remove(key);
    if (response.wasErrors()) {
        handleError(response, originatingRequest);
    } else {
        if (response.body() instanceof HttpResponse) {
            writeHttpResponse(originatingRequest.getReceiver(), ((HttpResponse) response.body()));
        } else {
            final RequestMetaData requestMetaData = metaDataProviderMap.get(RequestMethod.valueOf(originatingRequest.getMethod())).get(originatingRequest.address());
            final ServiceMethodMeta serviceMethodMeta = requestMetaData.getMethod();
            final int responseCode = serviceMethodMeta.getResponseCode();
            MultiMap<String, String> headers = response.headers();
            if (requestMetaData.getRequest().hasResponseHeaders()) {
                if (response.headers() == MultiMap.EMPTY) {
                    headers = new MultiMapImpl();
                } else {
                    headers = response.headers();
                }
                headers.putAllCopyLists(requestMetaData.getRequest().getResponseHeaders());
            }
            writeResponse(originatingRequest.getReceiver(), responseCode == -1 ? HttpStatus.OK : responseCode, serviceMethodMeta.getContentType(), jsonMapper.toJson(response.body()), headers);
        }
    }
}

boolean login(){
    if (callbackHandler == null) {
        throw new LoginException("Error: no CallbackHandler available " + "to garner authentication information from the user");
    }
    try {
        String[] certificateNames = new String[keyStore.size()];
        String[] aliasNames = new String[keyStore.size()];
        Enumeration<String> aliases = keyStore.aliases();
        for (int i = 0; i < keyStore.size(); i++) {
            aliasNames[i] = aliases.nextElement();
            certificateNames[i] = ((X509Certificate) keyStore.getCertificate(aliasNames[i])).getSubjectDN().getName();
        }
        Callback[] callbacks = new Callback[] { createChoiceCallback(certificateNames) };
        callbackHandler.handle(callbacks);
        int[] selectedIndexes = ((ChoiceCallback) callbacks[0]).getSelectedIndexes();
        if (selectedIndexes == null) {
            throw new LoginException("No certificate selected!");
        } else if (selectedIndexes[0] == -1) {
            throw new LoginException("Incorrect keystore password");
        }
        if (debug && _logger.isLoggable(FINE)) {
            _logger.log(FINE, "\t\t[ClientCertificateLoginModule] " + "user entered certificate: ");
            for (int i = 0; i < selectedIndexes.length; i++) {
                _logger.log(FINE, aliasNames[selectedIndexes[i]]);
            }
        }
        alias = aliasNames[selectedIndexes[0]];
        certificate = (X509Certificate) keyStore.getCertificate(alias);
        if (debug && _logger.isLoggable(FINE)) {
            _logger.log(FINE, "\t\t[ClientCertificateLoginModule] " + "authentication succeeded");
        }
        succeeded = true;
        return true;
    } catch (IOException ioe) {
