        return;
    }
    final RequestMetaData requestMetaData = metaDataProviderMap.get(RequestMethod.valueOf(request.getMethod())).get(request.address());
    final ServiceMethodMeta serviceMethod = requestMetaData.getMethod();
    if (serviceMethod.getMethodAccess().returnType() == void.class && !serviceMethod.hasCallBack()) {
        request.handled();
        final int responseCode = serviceMethod.getResponseCode();
        writeResponse(request.getReceiver(), responseCode == -1 ? HttpStatus.ACCEPTED : responseCode, serviceMethod.getContentType(), "\"success\"", requestMetaData.getRequest().getResponseHeaders());
    }
}

