void lexComment(){
    Matcher matcher = this.syntax.getRegexCommentClose().matcher(this.source);
    boolean match = matcher.find(0);
    if (!match) {
        throw new ParserException(null, "Unclosed comment.", this.source.getLineNumber(), this.source.getFilename());
    }
    String comment = this.source.substring(matcher.start());
    String reversedComment = new StringBuilder(comment).reverse().toString();
    Matcher whitespaceTrimMatcher = this.syntax.getRegexLeadingWhitespaceTrim().matcher(reversedComment);
    if (whitespaceTrimMatcher.lookingAt()) {
        this.trimLeadingWhitespaceFromNextData = true;
    }
    this.source.advance(matcher.end());
    this.popState();
}

void initialize(){
    MBeanServer server = getContainerWrapper().getResourceResolver().getMBeanServer();
    String serverName = getContainerWrapper().getTomcatContainer().getName();
    Set<ObjectInstance> threadPools = server.queryMBeans(new ObjectName(serverName + ":type=ThreadPool,*"), null);
    poolNames = new ArrayList(threadPools.size());
    for (ObjectInstance threadPool : threadPools) {
        ThreadPoolObjectName threadPoolObjectName = new ThreadPoolObjectName();
        ObjectName threadPoolName = threadPool.getObjectName();
        String name = threadPoolName.getKeyProperty("name");
        threadPoolObjectName.setThreadPoolName(threadPoolName);
        ObjectName grpName = server.getObjectInstance(new ObjectName(threadPoolName.getDomain() + ":type=GlobalRequestProcessor,name=" + name)).getObjectName();
        threadPoolObjectName.setGlobalRequestProcessorName(grpName);
        Set<ObjectInstance> workers = server.queryMBeans(new ObjectName(threadPoolName.getDomain() + ":type=RequestProcessor,*"), null);
        for (ObjectInstance worker : workers) {
            ObjectName wrkName = worker.getObjectName();
            if (name.equals(wrkName.getKeyProperty("worker"))) {
                threadPoolObjectName.getRequestProcessorNames().add(wrkName);
            }
        }
        poolNames.add(threadPoolObjectName);
    }
    Set<ObjectInstance> executors = server.queryMBeans(new ObjectName(serverName + ":type=Executor,*"), null);
    executorNames = new ArrayList(executors.size());
    for (ObjectInstance executor : executors) {
        ObjectName executorName = executor.getObjectName();
        executorNames.add(executorName);
