int getPenaltyScore(){
    int result = 0;
    for (int y = 0; y < size; y++) {
        int[] runHistory = new int[7];
        boolean color = false;
        int runX = 0;
        for (int x = 0; x < size; x++) {
            if (modules[y][x] == color) {
                runX++;
                if (runX == 5)
                    result += PENALTY_N1;
                else if (runX > 5)
                    result++;
            } else {
                addRunToHistory(runX, runHistory);
                if (!color && hasFinderLikePattern(runHistory))
                    result += PENALTY_N3;
                color = modules[y][x];
                runX = 1;
            }
        }
        addRunToHistory(runX, runHistory);
        if (color)
            addRunToHistory(0, runHistory);
        if (hasFinderLikePattern(runHistory))
            result += PENALTY_N3;
    }
    for (int x = 0; x < size; x++) {
        int[] runHistory = new int[7];
        boolean color = false;
        int runY = 0;
        for (int y = 0; y < size; y++) {
            if (modules[y][x] == color) {
                runY++;
                if (runY == 5)
                    result += PENALTY_N1;
                else if (runY > 5)
                    result++;
            } else {
                addRunToHistory(runY, runHistory);
                if (!color && hasFinderLikePattern(runHistory))
                    result += PENALTY_N3;
                color = modules[y][x];
                runY = 1;
            }
        }
        addRunToHistory(runY, runHistory);
        if (color)
            addRunToHistory(0, runHistory);
        if (hasFinderLikePattern(runHistory))
            result += PENALTY_N3;
    }
    for (int y = 0; y < size - 1; y++) {
        for (int x = 0; x < size - 1; x++) {
            boolean color = modules[y][x];
            if (color == modules[y][x + 1] && color == modules[y + 1][x] && color == modules[y + 1][x + 1])
                result += PENALTY_N2;
        }
    }
    int black = 0;
    for (boolean[] row : modules) {
        for (boolean color : row) {
            if (color)
                black++;
        }
    }
    int total = size * size;
    int k = (Math.abs(black * 20 - total * 10) + total - 1) / total - 1;
    result += k * PENALTY_N4;
    return result;
}

