            String line;
            while ((line = ir.readLine()) != null) {
                ow.write(line);
                ow.write("\n");
            }
            return ow.getBuffer().toString();
        } finally {
            if (ow != null) {
                ow.close();
            }
        }
    } catch (IOException ex) {
        System.out.println("unable to fetch URL:" + urlstr + ", reason: " + ex.getMessage());
