void advance(int amount){
    int index = 0;
    while (index < amount) {
        int sizeOfNewline = advanceThroughNewline(index);
        if (sizeOfNewline > 0) {
            index += sizeOfNewline;
        } else {
            index++;
        }
    }
    this.size -= amount;
    this.offset += amount;
}

